import React from 'react';

const TweetTextList = ({tweet}) => (
    <div className="grid-container2">
        {tweet.map((thistweet, key) => 
        <>
        <div key={key}>
            <p>{thistweet.text}</p>
        </div>
        </>
        )}
    </div>
)
const TweetsList = ({user}) => ( 
    <div className="grid-container2">
        {user.map((thisuser, key) => (
            <>
            <div key ={key}>
                <p>{thisuser.name}</p>
                <p>{thisuser.screen_name}</p>
            </div>
            </>
        ))}
    </div> 
)


export default TweetTextList;
